    constructor(){
        super();
        this.state={ //javascript object
            number:0
        }
    }

    increment(){
        number++;
    }

    render(){
        return(
            <div> 
                <h1>Counter={this.state.number} </h1>
                <button>increment</button>
            </div>
        )
    }
}

export default CounterClass;
